import React from "react";
import ReactDom from "react-dom";

const date = new Date();
var date1 = date.getDate();
var month = date.getMonth();
var year = date.getFullYear();
var time1 = date.getHours();
var time2 = date.getMinutes();
var time3 = date.getSeconds();

ReactDom.render(
  <>
   <h1>Hello my name is kevin prajapati!!</h1>
   <h2>Todays's date is {date1}\{month}\{year}</h2>
   <h2>Current time is {time1}:{time2}:{time3} {time1 < 12 ? "AM" : "PM"}</h2>
  </>
 ,
  document.getElementById("root")
);
